import React, { Component } from "react";
import PropTypes from "prop-types";

class Todo extends Component {
  render() {
    return <div>{this.props.todoProp.title}</div>;
  }
}

Todo.PropTypes = {
  todo: PropTypes.object.isRequired,
};
export default Todo;
